window.bookSummaryJSON = "<p><b>The chance of a lifetime...</b></p> <p><b>To live in a thrilling world of adventure...</b></p> <p><b>One with endless possibilities.</b></p> <p>Down on his luck and with his back against a wall, John Crussel would do anything to provide for his family.</p> <p>Even rob a bank out of desperation.</p> <p>But when he hears of how he can make money in a virtual reality video game called Alterlife, he walks away from the robbery and decides to give it a shot.</p> <p>Couldn't be harder than robbing a bank, could it?</p> <p>John's world is about to change as he finds that Alterlife is easier than it seems.</p> <p>But being a hotshot new guy that seems to have all the luck draws the attention of some dangerous people in Alterlife - ones that want what he has and are willing to do anything for it.</p> <p>Through a series of unfortunate events, John becomes the first to contract a deadly virus.</p> <p>Now he only has 10 days to live.</p> <p>He soon finds himself tied to a sinister plot and realizes that his misfortune may not be a coincidence.</p> <p>The mysterious virus was designed to kill players outside of the game. And John was targeted to be a carrier.</p> <p>Can he rid himself of the virus before time runs out?</p> <p>All John Crussel wanted was to make some easy money.</p> <p>He thought Alterlife was just a game....</p> <p><b>This high stakes novel depicts John's struggle both in and out of virtual reality. Fans of Otherland by Tad Williams, </b><b><i>Ready Player One</i></b><b>, and World of Warcraft will feel right at home in Alterlife.</b></p>"; 
